export default function (state = [], action) {
    console.log('estado:',state);
    console.log('accion:', action);
    switch (action.type) {
        case 'ADD_NUMBERS':
            console.log('payload:',action.payload);
            state.push(action.payload);
            return state.slice(0);
        case 'MULTIPLY_NUMBERS':
            return [];
        default:
            return state;
    }
}
